import {
  Card,
  TextField,
  Typography,
  FormGroup,
  FormControlLabel,
  Checkbox,
  Divider,
} from "@mui/material";
import React from "react";
import CheckBoxOutlineBlankIcon from "@mui/icons-material/CheckBoxOutlineBlank";

const QuestionCreator = () => {
  return (
    <Card
      sx={{
        p: 2,
        width: { sm: 410, lg: 550, xs: 310 },
        maxWidth: 700,
        minWidth: 200,
        mt: 2,
        mb: 3,
      }}
    >
      <TextField
        fullWidth
        placeholder="Dodaj pytanie"
        label="Pytanie"
        variant="standard"
        sx={{ mb: 2 }}
      ></TextField>
      <FormGroup>
        <Box>
          <CheckBoxOutlineBlankIcon />
          <TextField label="Odpowiedź" variant="standard"></TextField>
        </Box>
        <FormControlLabel
          control={<Checkbox name="1" />}
          label={<TextField label="Odpowiedź" variant="standard"></TextField>}
        />
        <FormControlLabel
          control={<Checkbox name="1" />}
          label={<TextField label="Odpowiedź" variant="standard"></TextField>}
        />
        <FormControlLabel
          control={<Checkbox name="1" />}
          label={<TextField label="Odpowiedź" variant="standard"></TextField>}
        />
      </FormGroup>
    </Card>
  );
};

export default QuestionCreator;
